namespace LeetCodePractice;

public class p_2812_Find_the_Safest_Path_in_a_Grid_TOO_SLOW
{

    public IList<IList<int>> GlobalGrid;
    public int[,] visitedGlobal;
    public Queue<Tuple<int, int, int>> safetySetting = new Queue<Tuple<int, int, int>>();
    
    // Directions for moving to neighboring cells: right, left, down, up
    int[][] dir = { new int[]{0, 1}, new int[]{0, -1}, new int[]{1, 0}, new int[]{-1, 0} };


    public void SetSafetyAround()
    {
        while (safetySetting.Count != 0)
        {
            Tuple<int, int, int> current = safetySetting.Dequeue();
            int i = current.Item1;
            int j = current.Item2;
            int safetyLevel = current.Item3;
            
            if (i > 0 && (GlobalGrid[i - 1][j] == 0 || GlobalGrid[i - 1][j] < safetyLevel))
            {
                GlobalGrid[i - 1][j] = safetyLevel;
                // SetSafetyAround(i-1, j, safetyLevel - 1);
                safetySetting.Enqueue(new Tuple<int, int, int>(i - 1, j, safetyLevel - 1));
            }

            if (i < GlobalGrid.Count - 1 && (GlobalGrid[i + 1][j] == 0 || GlobalGrid[i + 1][j] < safetyLevel))
            {
                GlobalGrid[i + 1][j] = safetyLevel;
                // SetSafetyAround(i+1, j, safetyLevel - 1);
                safetySetting.Enqueue(new Tuple<int, int, int>(i + 1, j, safetyLevel - 1));
            }

            if (j > 0 && (GlobalGrid[i][j - 1] == 0 || GlobalGrid[i][j - 1] < safetyLevel))
            {
                GlobalGrid[i][j - 1] = safetyLevel;
                // SetSafetyAround(i, j-1, safetyLevel - 1);
                safetySetting.Enqueue(new Tuple<int, int, int>(i, j - 1, safetyLevel - 1));
            }

            if (j < GlobalGrid.Count - 1 && (GlobalGrid[i][j + 1] == 0 || GlobalGrid[i][j + 1] < safetyLevel))
            {
                GlobalGrid[i][j + 1] = safetyLevel;
                // SetSafetyAround(i, j+1, safetyLevel - 1);
                safetySetting.Enqueue(new Tuple<int, int, int>(i, j + 1, safetyLevel - 1));
            }
        }
    }
    
    // Check if a path exists with given minimum safeness value
    private bool IsValidSafeness(int minSafeness) {
        int n = GlobalGrid.Count;

        // Check if the source and destination cells satisfy minimum safeness
        if (GlobalGrid[0][0] < minSafeness || GlobalGrid[n - 1][n - 1] < minSafeness) {
            return false;
        }

        Queue<int[]> traversalQueue = new Queue<int[]>();
        traversalQueue.Enqueue(new int[]{0, 0});
        bool[,] visited = new bool[n, n];
        visited[0, 0] = true;

        // Breadth-first search to find a valid path
        while (traversalQueue.Count > 0) {
            int[] curr = traversalQueue.Dequeue();
            if (curr[0] == n - 1 && curr[1] == n - 1) {
                return true; // Valid path found
            }
            // Check neighboring cells
            foreach (var d in dir) {
                int di = curr[0] + d[0];
                int dj = curr[1] + d[1];
                // Check if the neighboring cell is valid, unvisited and satisfying minimum safeness
                if (IsValidCell(di, dj) && !visited[di, dj] && GlobalGrid[di][dj] >= minSafeness) {
                    visited[di, dj] = true;
                    traversalQueue.Enqueue(new int[]{di, dj});
                }
            }
        }

        return false; // No valid path found
    }
    
    // Check if a given cell lies within the grid
    private bool IsValidCell(int i, int j) {
        int n = GlobalGrid.Count;
        return i >= 0 && j >= 0 && i < n && j < n;
    }
    
    public int MaximumSafenessFactor(IList<IList<int>> grid)
    {
        var watch = new System.Diagnostics.Stopwatch();
        
        watch.Start();
        
        int n = grid.Count;
        GlobalGrid = grid;
        
        visitedGlobal = new int[GlobalGrid.Count, GlobalGrid.Count];
        
        // Set safety factor of all cells
        for (int i = 0; i < n; i++)
        {
            for (int j = 0; j < n; j++)
            {
                if (grid[i][j] == 1)
                {
                    visitedGlobal[i,j] = 1;
                    safetySetting.Enqueue(new Tuple<int,int,int>(i, j, -1));
                }
            }
        }
        SetSafetyAround();
        
        Console.WriteLine($"Loop 1 Execution Time: {watch.ElapsedMilliseconds} ms");
        
        
        for (int i = 0; i < GlobalGrid.Count; i++)
        {
            for (int j = 0; j < GlobalGrid.Count; j++)
            {
                GlobalGrid[i][j] = Math.Abs(GlobalGrid[i][j]);
                // Console.Write(GlobalGrid[i][j] + " ");
            }
            // Console.WriteLine();
        }
        
        // Binary search for maximum safeness factor
        int start = 0;
        int end = 0;
        int res = -1;
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                // Set end as the maximum safeness factor possible
                end = Math.Max(end, GlobalGrid[i][j]);
            }
        }

        while (start <= end) {
            int mid = start + (end - start) / 2;
            if (IsValidSafeness(mid)) {
                // Store valid safeness and search for larger ones 
                res = mid; 
                start = mid + 1;
            } else {
                end = mid - 1;
            }
        }
        

