        //     queue.Enqueue(start);
        //     while (queue.Count != 0)
        //     {
        //         Tuple<int, int> x = queue.Dequeue();
        //         // Console.WriteLine("Current target:" + target + "(" + x.Item1 + "," + x.Item2 + ") " + "GlobalGrid Value:" + GlobalGrid[x.Item1][x.Item2] + " Visited status:" + visited[x.Item1, x.Item2]);
        //         if (GlobalGrid[x.Item1][x.Item2] <= target && visited[x.Item1, x.Item2] == 0)
